#!/usr/bin/env python
# -*- coding: utf-8 -*-

from nile.api.v1 import (
    clusters,
    extractors as ne,
    filters as nf,
    aggregators as na
)
from qb2.api.v1 import (
    filters as qf)


BAD_FILTER = 3


def read_sample(filename):
    sample = []
    with open(filename) as file:
        for line in file:
            sample += line.split()
    return sample


def is_blacklist_app(list_apps, blacklist_apps):
    if list_apps:
        for el in list_apps:
            if el in blacklist_apps:
                return 1
    return 0


if __name__ == '__main__':
    job = cluster.job()

    inst = job.table('$job_root/installs')

    dict_apps = job.table('home/search-research/lolita/antifraud/dash/dicts/dict_apps')

    markup = inst.join(
        dict_apps, by='device_id', type='left'
    ).project(
        ne.all(),
        is_emulators=ne.custom(lambda x: is_blacklist_app(x, EMULATORS), 'apps')
    ).put('$job_root/installs_with_markup')

    job.run()

import struct

def un(vector_m, vector_b):
    vector_m = list(struct.unpack('f'*256, vector_m))
    vector_b = list(struct.unpack('f'*256, vector_b))
    return vector_m.extend(vector_b)

stream = iter(job.table('$job_root/campaigns_with_vectors_transformed').read())
campaigns = set()
while True:
    try:
        rec = stream.next()
        campaign = rec.campaign_extended_name
        campaigns.add(campaign)
    except StopIteration:
        break

campaigns_with_emulators = df[
    df.is_emulators == 1
].groupby(
    'campaign_extended_name'
).is_emulators.count().sort_values().index[::-1].tolist()

